import { Box } from "@mui/material";
import styled from "styled-components";

const BoxCustomizado = styled(Box)`
  position: fixed;
  top: 50%;
  left: 50%;
  transform: translate(-50%, -50%);
  width: 30vw;
  max-height: 90vh;
  overflow-y: auto;
`;

export {BoxCustomizado}
